import React from 'react';
import { Typography, Divider, Row } from 'antd';
import { returnStatement } from '@babel/types';

import './Product_1.css'

import Pic from '../pic/1.png' 
const { Title } = Typography;

class Product_1 extends React.Component{
    render(){
        return(
            <div className='Product_1'>
                <img alt="example" src={Pic} />
                <div className='Product_1Content'>
                <Title>品    名：アイスクリスタル膠原蛋白</Title>

            </div>
            </div>

        )
    }
}
export default Product_1;
